import {
	Collapse,
	Navbar,
	NavLink,
	NavbarToggler,
	Nav,
	NavbarBrand,
	NavbarText,
	NavItem,
} from "reactstrap";

import { Link } from "react-router-dom";

import { UserContext } from "../Context/UserContext";

export default function Header() {
	return (
		<Navbar color="info" light expand="md">
			<NavbarBrand>
				<Link to="/" className="text-white">
					GitFire App
				</Link>
			</NavbarBrand>
			<NavbarToggler />
			<Collapse>
        <Nav className="ml-auto">
        <NavItem>
        <NavLink>
        </NavLink>
        </NavItem>
        </Nav>
			</Collapse>
		</Navbar>
	);
}
